import React, { useState } from 'react';
import './works.css';
import Portfolio1 from '../../assets/portfolio-1.png';
import Portfolio2 from '../../assets/portfolio-2.png';
import Portfolio3 from '../../assets/portfolio-3.png';
import Portfolio4 from '../../assets/portfolio-4.png';
import Portfolio5 from '../../assets/portfolio-5.png';
import Portfolio6 from '../../assets/portfolio-6.png';

const Works = () => {
    const [showMore, setShowMore] = useState(false);

    return (
        <section id='works'>
            <h2 className="worksTitle">My Portfolio</h2>
            <span className="worksDesc">
                I build robust data pipelines, automate workflows, and design scalable solutions that turn raw data into actionable insightsâ€”empowering teams to make smarter, faster decisions.
            </span>

            <div className="worksImgs">
                <a href="https://github.com/HillaryOnyango/BuyHouse" target="_blank" rel="noopener noreferrer">
                    <img src={Portfolio1} alt="Project 1" className="worksImg" />
                </a>
                <a href="https://github.com/HillaryOnyango/BuyHouse" target="_blank" rel="noopener noreferrer">
                    <img src={Portfolio2} alt="Project 2" className="worksImg" />
                </a>
                <a href="https://github.com/HillaryOnyango/BuyHouse" target="_blank" rel="noopener noreferrer">
                    <img src={Portfolio3} alt="Project 3" className="worksImg" />
                </a>
                <a href="https://github.com/HillaryOnyango/BuyHouse" target="_blank" rel="noopener noreferrer">
                    <img src={Portfolio4} alt="Project 4" className="worksImg" />
                </a>
                {showMore && (
                    <>
                        <a href="https://github.com/HillaryOnyango/BuyHouse" target="_blank" rel="noopener noreferrer">
                            <img src={Portfolio5} alt="Project 5" className="worksImg" />
                        </a>
                        <a href="https://github.com/HillaryOnyango/BuyHouse" target="_blank" rel="noopener noreferrer">
                            <img src={Portfolio6} alt="Project 6" className="worksImg" />
                        </a>
                    </>
                )}
            </div>

            <button className="workBtn" onClick={() => setShowMore(!showMore)}>
                {showMore ? "Show Less" : "See More"}
            </button>
        </section>
    );
}

export default Works;
